import React from "react";
import { useEffect,useState } from "react";
import { getCountry } from "../CountryService";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import './styles.scss'
function FormDetail({exit, iddetail }) {
 useEffect(() => {
   async function dataCountry() {
     let data = await getCountry(iddetail);
     setData(data.data);
   }

   dataCountry();
 }, [iddetail]);
  return (
    <>
      <div className="row">
        <div className="col-md-12  box-background">
          <div className="box-confirm ">
            <Form>
              <div className="box-title">
                <h3>Xem Chi tiết</h3>
              </div>
              <Form.Group className="input d-flex flex-column m-auto pb-10 ">
                <Form.Label>Name</Form.Label>
                <Form.Control type="text" value="" disabled />
              </Form.Group>

              <Form.Group className="input d-flex flex-column m-auto pb-10">
                <Form.Label>Code</Form.Label>
                <Form.Control type="text" value="" disabled />
              </Form.Group>
              <Form.Group className="input d-flex flex-column m-auto pb-10">
                <Form.Label>Description</Form.Label>
                <Form.Control type="text" value="" disabled />
              </Form.Group>
            </Form>
            <div className="button">
              <Button
                className="exit"
                variant="danger"
                type="submit"
                onClick={() => {exit(false)}}
              >
                Thoát
              </Button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default FormDetail;
